import React from "react";
import { useForm } from "react-hook-form";
const Adress = () => {
    const {
        register,
        formState: { errors },
        handleSubmit,
    } = useForm();

  return (
    <div>
        <input
          type="text"
          placeholder="Country"
          {...register("country", { required: true, maxLength: 80 })}
        />
        <input
          type="text"
          placeholder="City"
          {...register("city", { required: true, maxLength: 100 })}
        />
        <input
          type="number"
          placeholder="Postal Code"
          {...register("PostalCode", { required: true })}
        />
        <input
          type="text"
          placeholder="Street"
          {...register("street", { required: true })}
        />
        <input
          type="number"
          placeholder="House Num"
          {...register("housNum", {})}
        />
    </div>
  );
};

export default Adress;
